INSERT INTO `products` VALUES (1,'\\\"冰露\\\"饮用纯净水','零食','饮料','纯净水','冰露(Ice Dew)是可口可乐(Coca-Cola)公司出品的一款矿物质水饮料。','规格：550ML*12瓶(新老包装随机发货)\\n产地：中国\\n食用方法：开瓶即饮\\n贮存方法：阴凉避光处','uploadFile/125e370e-5b44-453c-a275-1ddb5a1c496b.jpg','uploadFile/7688b725-eaf2-4cca-9b00-7305a8d14bd8.jpg','uploadFile/c0c78db5-5eee-4cd4-b1d7-66681b5f8327.jpg','uploadFile/fec47142-0448-474f-9138-28451769bbf1.jpg','2019-02-04 07:15:48','2019-02-04 07:15:48','瓶'),(2,'铜锣烧','食品','糕点','热加工','铜锣烧，又叫黄金饼。因为是由两块像铜锣一样的饼合起来的，故而得名铜锣烧。是一种烤制面皮、内置红豆沙等夹心的甜点，日本人喜爱的糕点，日本卡通人物哆啦A梦和哆啦A梦七小子最爱的食品。','用两片圆盘状，类似蜂蜜蛋糕的饼皮包裹豆沙馅，因为形状类似两个合在一起的铜锣而得名。而对于中国人来说，其实就是我们更为熟悉的豆沙饼。\\n铜锣烧饼皮散发浓郁的蜂蜜香气，口感松软，细致的外皮与香滑的内馅，交融出绝妙的好滋味。无论是原味红豆风味，还是浓情奶油风味、自然草莓果味，搭配珍珠奶茶或咖啡也是非常好的享受；直接食用也是一样出色。 \\n大阪铜锣烧采用纯手工制作，配方源于日本料理大师，为了适合中国人的口味，除了传统的原味红豆，又开发出肉松、牛奶、绿豆、蓝莓、草莓、奶油等口味，新鲜纯正的浓郁口感，值得机器猫迷们细细的品尝。','uploadFile/7af7ef9e-d7ec-4b30-a979-3b868b7884a5.jpg','uploadFile/5cc5fdc3-5ad0-4efe-b767-b401a79d2dd1.jpg','uploadFile/92bf571f-d13a-4ce7-824a-b6cc43489063.jpg','uploadFile/a02c1ab6-4ba5-4e98-a590-57060cdf71e5.jpg','2019-02-04 07:48:30','2019-02-04 07:48:30','g'),(3,'华夫饼','食品','糕点','热加工','华夫饼，又叫窝夫、格子饼、格仔饼、压花蛋饼，是一种烤饼，源于比利时，用配有专用烤盘(waffle iron)的烤炉制成。','华夫饼属于点心菜谱，主要原料是鸡蛋和牛奶，蛋含有丰富的蛋白质、脂肪、维生素和铁、钙、钾等人体所需要的矿物质，蛋白质为优质蛋白，对肝脏组织损伤有修复作用；富含DHA和卵磷脂、卵黄素，对神经系统和身体发育有利，能健脑益智，改善记忆力，并促进肝细胞再生；鸡蛋中含有较多的维生素B和其他微量元素，可以分解和氧化人体内的致癌物质，具有防癌作用。','uploadFile/369123a4-eacb-46e0-b95f-db51d26687da.jpg','uploadFile/bc1a27ae-d7b1-4ed7-90c1-ffe6b07c63d7.jpg','uploadFile/f7e5529b-a327-46b3-a55b-7ed1826a1d86.jpg','uploadFile/4786f5b2-88e9-4498-88cf-fe5bc62f885f.jpg','2019-02-04 08:13:36','2019-02-04 08:13:36','g'),(4,'菠萝派','食品','糕点','热加工','菠萝派，是一种面包品种。主料有菠萝、黄油、白砂糖、水淀粉，辅料有飞饼、鸡蛋等。','用料\\n菠萝200克\\n酥皮400克\\n辅料\\n盐1/2茶匙\\n水200毫升\\n细砂糖2茶匙\\n奶油10克\\n鸡蛋1个\\n玉米淀粉1茶匙\\n家庭版菠萝派的做法\\n1.用一碗，装200毫升的清水，加盐1/2茶匙，搅拌均匀，放入菠萝块，泡约10分钟\\n2.泡好后沥干水，切成玉米粒般大小的丁，放入锅里炒，等到一出水时，加入无盐奶油10克，翻匀，再加细砂糖2茶匙和玉米淀粉1茶匙，快速兜匀\\n3.看见锅里的菠萝馅已粘稠时，熄火，将馅料盛出备用\\n4.从冰箱里取出派皮，趁冻赶快打开，再将皮摊开，不然一回暖就会粘在一起了，用尽子量量折痕，再按两拆痕间的长度，打横地做出记号，目的是做方形的派\\n做法三\\n食材\\n主料\\n菠萝1个、黄油适量、白砂糖适量、水淀粉适量\\n辅料\\n飞饼适量、鸡蛋1个\\n步骤\\n1. 菠萝去皮切片。\\n2. 菠萝片切小丁，锅中小火融化一小块黄油，入菠萝丁、白砂糖、适量淀粉水，小火炒至馅变浓稠。盛出备用。\\n3. 两张飞饼叠放一起，撒干粉擀均匀，边角修平呈正方形，放入菠萝馅，四条边涂上蛋液（粘合用）。\\n4. 饼皮对折，用叉子压出花纹，表面划三刀，刷层蛋液。\\n5. 烤箱185度烤25分钟，香味扑鼻的菠萝派就完成啦','uploadFile/1feb80ef-9bae-48a2-9f0d-08254740688f.jpg','uploadFile/523c3a84-8f99-4da6-8989-6f9584c5c862.jpg','uploadFile/17d57b76-7b8b-418e-bd5c-a41704811054.jpg','uploadFile/10344b2d-9f3f-4037-a467-3381e4802a09.jpg','2019-02-04 08:21:53','2019-02-04 08:21:53','个'),(5,'三文鱼刺身','生鲜','水产','鱼类','三文鱼刺身就是用三文鱼做成的生鱼片料理。“刺身”是日本的传统食品，是日本料理中最清淡的菜式，非常受日本人欢迎。','含有丰富的不饱和脂肪酸，能有效降低血脂和血胆固醇，防治心血管疾病。所含的Ω-3脂肪酸更是脑部、视网膜及神经系统所必不可少的物质，有增强脑功能、防治老年痴呆和预防视力减退的功效。在鱼肝油中该物质的含量更高。三文鱼能有效地预防诸如糖尿病等慢性疾病的发生、发展，具有很高的营养价值，享有“水中珍品”的美誉。鱼肝油中还富含维生素D等，能促进机体对钙的吸收利用，有助于生长发育。','uploadFile/30b15b03-888b-43cb-97bc-e70265c683ad.jpg','uploadFile/c6abaf50-ceac-484b-bf48-b227964956c2.jpg','uploadFile/4f533002-94e8-4301-8b38-bf556b5bea39.jpg','uploadFile/2917f758-3e1b-4340-874e-6bc48fb6e4c6.jpg','2019-02-04 08:24:57','2019-02-04 08:24:57','g'),(6,'舒芙蕾（蛋奶酥）','食品','糕点','热加工','由面粉、鸡蛋的蛋白部分、牛奶和糖等成分调好后在烤箱中烤熟。这种糕点在烤的过程中逐渐膨胀，因此烤好后又松又软。Souffle可以热吃，也可以冻冷后再吃。通常，烤这种糕点的小敞口烤盘会同糕点一起送到餐桌上。大多数和Souffle中还加有蔬菜和水果等成分，常见的有苹果Souffle、脆梨Souffle、香蕉Souffle、蜜桃Souffle、巧克力Souffle和橙汁Souffle等。','据说，Souffle的来源，与当时欧洲社会奢侈糜烂、贪得无厌的风气相关。由于社会日渐富裕，民风也趋于崇尚享乐，人们花在吃喝上的时间比花在工作上的时间多好几倍，时常举行奢华的宴会……终于有人看不过眼了，发明了这款寓意“过度膨胀的虚无物质主义，最终难逃倒塌的命运”的点心，完全是愤世嫉俗的革命者的语气。<br>另一种说法，中世纪的诞生——Souffle（法国） 为什么人们会发明这道让人吃完后，反而感觉好像什么都没吃的舒芙里；这和当时贪婪无餍、欲求永不满的社会风气息息相关。当时富裕的老百姓们花在吃的时间比工作的时间多上好几倍，往往三、四个人的餐会，十几二十道菜，多得吃不完，吃到最后，宾客都仅意思意思地动动刀叉，浅尝即止；宴会结束后，一整个下午，只听见打饱嗝的声音此起彼落，这个「下午打嗝」的社会现象维持了整整半个世纪，直到引起社会清流人士如此的蜚短流长方才告一段落：「连「虚无」也难逃物质化，并因过度膨胀而遭到倒塌的命运。为了矫正败坏的饮食风气，厨师们特地运用无滋无味无重的蛋白，变化成这道虚无的美食；然而，厨师们又害怕过度膨胀的虚无物质主义，又将如预言一般，终将难逃坍塌的命运，所以千方百计地想让舒芙里在送达客人食用之前，能保持优雅蓬松的原貌。','uploadFile/47e0d263-70d3-4a96-8c3c-c5ae1481a268.jpg','uploadFile/fb76c7ed-0de1-47ec-ac27-f515e7991b38.jpg','uploadFile/5898c9ce-5278-4501-9953-3688c0ca9487.jpg','uploadFile/69f517d5-b674-4a70-9665-2154dd32f3f6.jpg','2019-02-05 01:10:03','2019-02-05 01:10:03','个'),(7,'半熟芝士','食品','糕点','热加工','半熟芝士的半熟，一是指轻度的烘焙（bèi）方式，火候经过了反复精确计算，确定在指定的阈值，使其烘焙至半熟未熟的程度，状态更加轻盈。其二则因为介于生芝士与全熟芝士之间，半熟芝士会有绵软细腻的美味口感，这也正是半熟芝士的魅力所在。','2014年，好利来两位青年领袖亲自拜访了日本“半熟芝士之父”中山满男，经3次恳切诚挚的拜访才终于以好利来出色的蛋糕工艺打动了他，中山满男决定来实地考察。2014年中山满男来到了北京好利来工厂研发中心考察，终于决定亲自传授半熟芝士的做法，但提出“正式上市一个月后还会来检查，若没有达到标准则会收回授权”的要求。一个月后的检查发现，半熟芝士用料口感味道以严苛的标准在规范执行，口味与自己所做保持严格一致，甚至模具制造方面还有了意想不到的突破，从此中山满男老师就把半熟芝士放心地交由好利来制作了。&#10&#10这就是关于好利来半熟芝士的历史，质量过硬的技术+实施创新的精神创造了非常出名的网红产品半熟芝士，某雪非常喜欢好利来的半熟芝士，某雪将带来全系列口味测评，好利来半熟芝士全系列试吃测评！好吃到流泪，不看你就out了','uploadFile/f3a8d31c-a76e-4ad1-be85-19a169ea8d80.jpg','uploadFile/943ec5b4-f9e8-47fd-87ed-b787c3e3fcd2.jpg','uploadFile/9a973d80-0912-4e04-9374-98cf686cc36d.jpg','uploadFile/f9afc4c1-032f-420f-9e57-733ed71c73ec.jpg','2019-02-05 01:19:27','2019-02-05 01:19:27','个'),(8,'大马哈鱼','生鲜','水产','鱼类','肉质鲜美，物美价廉的鲑鱼','大马哈鱼是鲑形目（Salmoniformes）其中一种，属鲑科鱼类，是鲑鱼的一种，是著名的冷水性溯河产卵洄游鱼类。有9亚目25科146属510种，纯淡水种类82种。','uploadFile/2d244b97-0d41-422f-b2ff-dce7e4c592ff.jpg','uploadFile/0cda9890-e601-4046-b7c8-4d77d84e2a22.jpg','uploadFile/10d92af2-bb26-413e-9c2f-2f3802b65ead.jpg','uploadFile/30e61a05-8eb6-4ec3-ac68-7334ab226281.jpg','2019-02-05 02:26:27','2019-02-05 02:26:27','g（克）'),(9,'黄花鱼','生鲜','水产','鱼类','黄花鱼','黄花鱼，Larimichthys (D. S. Jordan et Starks，1905)，又名黄鱼，石首鱼科黄鱼属的一属黄鱼的统称。生于东海中，鱼头中有两颗坚硬的石头，叫鱼脑石，故又名石首鱼。鱼腹中的白色鱼鳔可作鱼胶，有止血之效，能防止出血性紫癜。\\n黄花鱼分为大黄鱼（Pseudosciaena crocea）和小黄鱼（Psendosciaena polyactis），分别为我国四大海洋业品种之一。大黄鱼也叫大先、金龙、黄瓜鱼、红瓜、黄金龙、桂花黄鱼、大王鱼、大黄鲞；小黄鱼也叫梅子、梅鱼、小王鱼、小先、小春鱼、小黄瓜鱼、厚鳞仔、花鱼。都隶属硬骨鱼纲，鲈形目，石首鱼科，黄鱼属 。\\n黄鱼曾是中国重要经济鱼之一，为中国特有的地方性种类，广泛分布于北起黄海南部，经东海、台湾海峡，南至南海雷州半岛以东。该鱼属暖温性集群泅游鱼类，常栖息于水深60米以内的近海中下层。大黄鱼生殖季节有春、秋两季，生殖期时，鱼群分批从外海越冬区向近海作生殖洄游。作为名贵经济鱼类，大黄鱼长期来深受消费者青睐。但因过度捕捞，资源破坏严重。','uploadFile/fb58aeb2-ef66-47ba-b181-1fa6d85594f4.jpg','uploadFile/3e805abe-3d71-4033-8609-4d1ddd2d2fb0.jpg','uploadFile/f8db6f17-464f-498c-b973-a63ad6f12560.jpg','uploadFile/7ea6594f-08ee-4292-a7ee-63c2eb31be38.jpg','2019-02-05 02:42:22','2019-02-05 02:42:22','g'),(10,'大白菜','生鲜','时令蔬菜','绿色蔬菜','大白菜（学名：Brassica rapa pekinensis，异名Brassica campestris pekinensis或Brassica pekinensis）是一种原产于中国的蔬菜，又称“结球白菜”、“包心白菜”、“黄芽白”、“胶菜”等，在粤语里叫“绍菜”。','大白菜（学名：Brassica rapa pekinensis，异名Brassica campestris pekinensis或Brassica pekinensis）是一种原产于中国的蔬菜，又称“结球白菜”、“包心白菜”、“黄芽白”、“胶菜”等，在粤语里叫“绍菜”。\\n大白菜与小白菜是近亲，同属芸薹一种，和原产地中海沿岸的圆白菜也较近，同属十字花科芸薹属。\\n目前国内的大白菜品种中，以黄心菜食用量居多，因其口感好，口味佳，深受老百姓喜爱。现有的黄心白菜品种中，秋美秀表现尤为突出，种植面积较大。\\n白菜原产于我国北方，是十字花科芸薹属叶用蔬菜，通常指大白菜。引种南方，南北各地均有栽培。十九世纪传入日本、欧美各国。大白菜种类很多，北方的大白菜有山东胶州大白菜、北京青白、天津青麻叶大白菜、东北大矮白菜、山西阳城的大毛边等。','uploadFile/01a0ab20-d142-43e1-bdd3-77b3f197868b.jpg','uploadFile/4b4d88ad-31b6-4861-8b24-0ed861ac5e56.jpg','uploadFile/dc9390a9-3bee-447b-aed6-91f4808fd1c5.jpg','uploadFile/9b4b7974-37cc-4928-b13b-ff388b032838.jpg','2019-02-05 05:51:45','2019-02-05 05:51:45','kg'),(11,'鱿鱼','生鲜','水产','鱼类','鱿鱼','鱿鱼，也称柔鱼、枪乌贼，是软体动物门头足纲鞘亚纲十腕总目管鱿目开眼亚目的动物。体圆锥形，体色苍白，有淡褐色斑，头大，前方生有触足10条，尾端的肉鳍呈三角形，常成群游弋于深约20米的海洋中。','uploadFile/1a8d4e4b-1620-449b-a367-aed866937380.jpg','uploadFile/1e8096cb-5940-4679-8cf7-b6be978cbc4d.jpg','uploadFile/d699ebd2-2931-4b43-9a1c-64698c563a54.jpg','uploadFile/63642fa3-d7b5-410d-bd86-29c05c70357a.jpg','2019-02-05 02:49:48','2019-02-05 02:49:48','g'),(12,'鳗鱼','生鲜','水产','鱼类','鳗鱼','鳗鱼， 别名：白鳝、白鳗、河鳗、鳗鲡、青鳝、风馒、日本鳗。鳗鱼是指属于鳗鲡目分类下的物种总称。又称鳝，是一种外观类似长条蛇形的鱼类，具有鱼的基本特征。此外鳗鱼与鲑鱼类似具有洄游特性。鳗鱼属鱼类，似蛇，但无鳞，一般产于咸淡水交界海域。','uploadFile/e4bc7f51-22ba-4a72-a11d-ed4a9895abc6.jpg','uploadFile/3de87be4-86a7-40c9-bfdc-04ce7d7f4de2.jpg','uploadFile/9b5a0b8a-37d6-4f70-99bc-0d80ac0d4ff7.jpg','uploadFile/70b5f9ec-9908-4e96-b71d-85fba9c2057f.jpg','2019-02-05 02:51:35','2019-02-05 02:51:35','g'),(13,'金枪鱼','生鲜','水产','鱼类','金枪鱼','金枪鱼又叫鲔鱼，香港称吞拿鱼，澳门以葡萄牙语旧译为亚冬鱼，大部分皆属于金枪鱼属。金枪鱼的肉色为红色，这是因为金枪鱼的肌肉中含有了大量的肌红蛋白所致。有些金枪鱼，例如蓝鳍金枪鱼可以利用泳肌的代谢；使体内血液的温度高于外界的水温。这项生理功能使金枪鱼能够适应较大的水温范围，从而能够生存在温度较低的水域。','uploadFile/0a1ec84a-d62a-4255-904d-9ca3c599a865.jpg','uploadFile/90b869a9-2875-4eba-8dd7-43976cd94579.jpg','uploadFile/de65ef70-5afd-4d6b-b972-1946ed9da557.jpg','uploadFile/c75c3416-0946-4d37-a65e-531c75d195fe.jpg','2019-02-05 02:53:39','2019-02-05 02:53:39','g'),(14,'可口可乐','零食','饮料','有色饮料','1886年，可口可乐在美国乔治亚州亚特兰大市诞生，自此便与社会发展相互交融，激发创新灵感。现在，它每天为全球的人们带来怡神畅快的美妙感受。','目前，全球每天有17亿人次的消费者在畅饮可口可乐公司的产品，大约每秒钟售出19,400瓶饮料，在2016年10月，可口可乐公司排2016年全球100大最有价值品牌第三名 [1]  ；可口可乐为中国消费者提供超过15个品牌50多种饮料选择，其系列产品在华的每天享用量达到1.5亿杯， [2]  可口可乐自1979年重返中国市场至2014年底，已累计投资超过90亿美元，目前在华建有43家工厂，系统员工约45,000人，其中99%为本地员工， [3]  可口可乐及其装瓶厂在中国长期以来不遗余力地支持教育及公益事业，推广环境保护以及帮助当地社区的发展，捐资总额超过2.7亿元人民币，另外，可口可乐亦是唯一一个全方位赞助在中国举办的特奥会、奥运会、残奥会、世博会、大运会及青奥会的企业。','uploadFile/ae43dc4e-4886-43a9-b162-46e74070486c.jpg','uploadFile/bb42bbe7-e138-4b99-9b1a-fd80cd6aa655.jpg','uploadFile/60eba729-9863-413b-aff1-a4184a009129.jpg','uploadFile/d70de8c6-a277-46ad-99ea-0a1444f3900d.jpg','2019-02-05 03:02:00','2019-02-05 03:02:00',''),(15,'七喜','零食','饮料','有色饮料','七喜（英文原名7-Up）是Dr Pepper/Seven Up公司的柠檬汽水品牌，从1987年开始生产瓶装产品。在美国境外，七喜是百事公司的注册商标。七喜原名为Bib-Label Lithiated Lemon-Lime Soda，1929年在密苏里州圣路易斯开始生产。','七喜由Howdy Corporation的创始人查尔斯・格利戈创造。它在这之前的产品叫作Howdy橙味汽水。经过2年多时间对不同配方的尝试。查尔斯希望这一新的配方可以给消费者带来不同的感受。他在1929年金融危机2周之前开始生产其产品。查尔斯从未解释产品为什么叫作7up。最普遍的说法是7和u说明七喜包含7种调料并且进行过碳酸化。','uploadFile/81cac0f6-0f95-4936-b717-e1b8abc4cd46.jpg','uploadFile/fa616107-13ae-4181-9159-b29cb864c4dd.jpg','uploadFile/0a5d2d3c-c540-4cee-bfb2-4b74bc56da4a.jpg','uploadFile/bd5ea08f-c2ce-4536-a056-8de41142bcef.jpg','2019-02-05 03:14:08','2019-02-05 03:14:08','瓶'),(16,'健力宝','零食','饮料','有色饮料','健力宝诞生于1984年，含有“健康、活力”的保健意义。1984年洛杉矶奥运会后一炮走红，被誉为“中国魔水”。作为中国第一个添加碱性电解质的饮料，健力宝率先为国人引入运动饮料的概念。','健力宝成立于1984年，经过三十多年的风雨历程，已经成长为一个以饮料生产为主导产业，拥有享誉全国的知名饮料品牌——健力宝，并涉足制罐、塑料、包装、调味品、房地产等多种行业的大型现代化企业集团。\\n健力宝集团拥有多个知名品牌：健力宝、第五季、爆果汽、爱运动、A8、宝丰等，其中健力宝是饮料业务的核心品牌，已有二十多年的历史，在全国范围内享有极高的知名度。\\n新世纪，新篇章。未来，健力宝集团将进一步突出主业，以做\\\"代表中华民族文化的企业品牌\\\"为崇高奋斗目标，以健康产业为龙头，以打造百年民族品牌为己任，致力于建设一个强大的健力宝产业王国，再创民族饮料的新辉煌。','uploadFile/f56757de-da0b-49a4-afc3-a72da2687abd.jpg','uploadFile/2d9347be-1d9a-4969-b012-92e997340c97.jpg','uploadFile/e3fdd835-3413-4a81-9b5a-a74c3bc0ff79.jpg','uploadFile/e612c6d1-3928-4375-9f33-0a73fc0db564.jpg','2019-02-05 03:39:43','2019-02-05 03:39:43','瓶'),(17,'雪碧','零食','饮料','有色饮料','1961 年，「雪碧」这一款柠檬味汽水饮料，由可口可乐公司推出的第三个品牌。','“雪碧”一词，音译自英语Sprite，原意为妖怪、精灵。精灵小子这个角色频繁出现于19世纪40、50年代的可口可乐海报中。 [4]  精灵小子脸上带着顽童般的笑容，身边总伴有星光闪烁，象征着他活泼的性格和可乐里的气泡。这个Sprite Boy和大家所熟悉的雪碧(Sprite)其实毫无关联，雪碧这个品牌直到1961年才问世。 [4]  作为一种饮料，把它译为“雪碧”可谓是煞费苦心。雪，有寒意,符合汽水的清凉口感；碧，清澈碧绿，契合瓶身外包装颜色，既符合中国消费者的认知，又巩固了品牌形象。在大夏天，这样的饮料名，听着就想喝。这样的字又何止“一字千金”呢？ [1] ','uploadFile/96a3e267-ba6e-4d60-b56c-53d94394e58f.jpg','uploadFile/8a949347-7854-4cc2-8dfb-946fcce05e10.jpg','uploadFile/0d6089cf-ca8d-40b1-a070-912c3241e875.jpg','uploadFile/05721675-ecb3-453a-9b65-fba34c6f5ab5.jpg','2019-02-05 03:42:41','2019-02-05 03:42:41','瓶'),(18,'“哇哈哈”AD钙奶','零食','饮料','有色饮料','AD钙奶是娃哈哈旗下的饮品，采用钙质吸收的上佳载体——牛奶为基础，又辅以维生素A和维生素D，促进钙质吸收，达到真正补钙，现有原味、巧克力、椰芋等多种口味。','营养成分表\\n每100ml产品中含\\n能量≥1010KJ\\n钙40mg-80mg\\n维生素A 30 I.U.g -100 I.U. g\\n维生素D 1 I.U.g-4 I.U. g\\n蛋白质≥1.0g\\n脂肪≥0.4g\\n碳水化合物≥4.0g','uploadFile/67658c9f-ba63-4eac-a623-a222d26b521f.jpg','uploadFile/89804970-ac20-4d08-b93c-942e784a952a.jpg','uploadFile/05728394-b924-4d22-9ee5-27ae10c47b68.jpg','uploadFile/df4ed971-c35e-4482-b292-a349530c19e9.jpg','2019-02-05 03:45:08','2019-02-05 03:45:08','箱'),(19,'怡宝','零食','饮料','纯净水','怡宝纯净水，中国饮用水市场的知名品牌，用30年的专业经验保证产品的安全和纯净，采用世界上先进的二级反渗透技术，确保每一滴水水质纯净。怡宝是饮用水至纯至净的倡导者及执行者，更是呼吁人们内心纯净的先行者，以“心纯净、行至美”的品牌主张，引导社会价值，希望通过始终如一的品质追求和不断进取的创新精神，为社会贡献企业价值和社会责任，创造美好世界。\\n','产品说明\\n怡宝纯净水保证了低TDS值、高纯净的标准更使水的口感天然甘甜，带给你清润安全的生命之水。\\n纯净水系列：350ml、555ml、1555ml、4.5L、5加仑。','uploadFile/eb54cbc6-e909-4e32-8c71-8480316de21b.jpg','uploadFile/2dc1b4d7-e2cb-4627-9886-ac26b1a8bbaf.jpg','uploadFile/7892ab5e-ab39-47d4-938a-6637f1bbf0ea.jpg','uploadFile/98ec50b7-1db8-4fc8-bd21-08392f2540ad.jpg','2019-02-05 05:31:50','2019-02-05 05:31:50','瓶'),(20,'景田百岁山天然矿泉水','零食','饮料','纯净水','景田百岁山天然矿泉水采用千年未被改变和触动过的百岁山天然矿泉水源，为世上少见的优质矿泉水水源之一，其水质天然纯净、无污染，倍显甘甜，经专家鉴定为优质、天然矿泉水','天然矿物质含量:mg/L 溶解性总固体...60.0-180.0\\n偏硅酸H2SiO3...40.0-80.0 重碳酸盐HCO3....20.0-80.0\\n钙Ca2+..........2.0-15.0 钠Na+...........1.0-15.0\\n钾K+...........1.0-8.0 氯化物CL-........1.0-20.0\\n镁Mg2+.........0.5-6.0 硫酸盐SO42-.......0.5-1.0 (PH值6.0-7.5不含二氧化碳)\\n景田百岁山生产基地，位于著名的国家级风景名胜区及道教圣地——罗浮山脉自然保护区，该区青山叠嶂，林海馨波，古木苍天，百里无烟。一流的自然生态环境，赋予了百岁山优质的矿泉资源，在特定的地质环境作用下，水源经百余年深层循环及涌动，富含了偏硅酸、锂、锶、钙、钾等多种有益于\\n人体健康的微量元素，其中的偏硅酸对人体主动脉硬化具有软化作用，对心脏病、高血压、动脉硬化、神经功能紊乱、胃病及胃溃疡等均有保健作用，并具有抗癌抗衰老的功能。景田百岁山天然矿泉水采自于地层160米深之下的岩石断裂带之中，专家鉴定为世上少见的优质矿泉水水源之一。“景田百岁山饮用天然矿泉水”水源地处惠州罗浮山，是国家特殊批准的高品质矿泉水源，批准号为[国土资矿水发（2000）90072]。百岁山的千年完美天然从未被改变和触动过，为中国丝毫未受污染的水源地之一。优质的水源配上贵气的包装，构筑成完美的景田百岁山饮用天然矿泉水。','uploadFile/c78ff705-362f-4060-8967-35683e14e55d.jpg','uploadFile/16fdf74c-eeb0-40f1-b653-b2d367e0d912.jpg','uploadFile/60e88ff2-5dab-4823-b4a6-7ee00f11a63d.jpg','','2019-02-05 05:34:44','2019-02-05 05:34:44','瓶'),(21,'农夫山泉 - 天然的弱碱性水','零食','饮料','纯净水','农夫山泉 - 天然的弱碱性水\\n农夫山泉选取天然的优质水源，仅对原水做最小限度的、必要的处理，保存了原水中钾、钠、钙、镁、偏硅酸等对人体有益的矿物元素，pH值为7.3±0.5，呈天然弱碱性，适于人体长期饮用。\\n','农夫山泉选取天然的优质水源，仅对原水做最小限度的、必要的处理，保存了原水中钾、钠、钙、镁、偏硅酸等对人体有益的矿物元素，pH值为7.3±0.5，呈天然弱碱性，适于人体长期饮用。\\n\\n','uploadFile/db3ccafb-8a9e-44a3-b2cd-5dc798f3f6b2.png','uploadFile/665aa011-fb9c-4b75-a4df-78c1e3b10d4c.png','uploadFile/716a6bd9-8c2b-4cbc-927c-59981d2604d0.png','uploadFile/1dbad41c-7e60-4109-abdd-d5384ac3a896.png','2019-02-05 05:42:05','2019-02-05 05:42:05','瓶/桶');
