DROP TABLE IF EXISTS `products_by_store`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `products_by_store` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '单纯的主键，自增长',
  `store_id` int(11) NOT NULL COMMENT '门店id',
  `product_id` int(11) NOT NULL COMMENT '产品id',
  `inventory` int(11) NOT NULL COMMENT '库存',
  `original_price` double NOT NULL COMMENT '原始售价',
  `discount` double NOT NULL DEFAULT '1' COMMENT '折扣系数售价=original_price* discount\n',
  `product_status` int(11) NOT NULL COMMENT '商品状态。\n1：上架；\n0：下架\n',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=155 DEFAULT CHARSET=utf8 COMMENT='门店商品信息表，用于维护各门店的库存信息，里面有大量的元组，每个元组记录某某门店对某种商品的库存量及其他信息';
